// Get icon component by name from curated list
export function getPageIcon(iconName: string | undefined): FluentIcon {
  if (!iconName) return DocumentRegular;
  return PAGE_ICONS[iconName] || DocumentRegular;
}

// Check if an icon name exists in the curated list
export function isCuratedIcon(iconName: string): boolean {
  return iconName in PAGE_ICONS;
}

// Check if an icon name is valid (exists in full Fluent UI pack)
export function isValidIconName(iconName: string): boolean {
  return ALL_ICON_NAMES.includes(iconName);
}

// Get display name from icon name (e.g., "PersonRegular" -> "Person")
export function getIconDisplayName(iconName: string): string {
  return iconName.replace(/Regular$/, '');
}

// Default icons based on page type
export const DEFAULT_PAGE_ICONS: Record<string, string> = {
  lookup: 'DocumentRegular',
  report: 'DataPieRegular',
};

// Dynamically import an icon by name (for icons not in curated list)
export async function loadIconByName(iconName: string): Promise<FluentIcon | null> {
  // First check curated list
  if (PAGE_ICONS[iconName]) {
    return PAGE_ICONS[iconName];
  }

  // Validate the name exists
  if (!isValidIconName(iconName)) {
    return null;
  }

  try {
    // Dynamic import from the full package
    const icons = await import('@fluentui/react-icons');
    const icon = (icons as unknown as Record<string, FluentIcon>)[iconName];
    return icon || null;
  } catch {
    return null;
  }
}
